  input: TEXT,"F3XA","","Please note that this is a conforming amendment to carry
    through corrections made to reports filed during the 2004 election cycle. The
    Committee disclosed payments for Salaries/Wages for this period on Schedule H4
    for Line 21a, and Schedule B for Line 30b.  The Committee pays its employees with
